import React from 'react'
import '../components/Header.css';
import Glone from "../assets/pexels-burst-545012.jpg";
import Gltwo from "../assets/pexels-cats-coming-707581.jpg";
import Glthree from "../assets/pexels-charlotte-may-5824497.jpg";
import Glfive from "../assets/pexels-nastyasensei-376531.jpg";
import Glsix from "../assets/pexels-dmitry-zvolskiy-2062431.jpg";
import Glseven from "../assets/pexels-jean-van-der-meulen-1454806.jpg";
import Alone from "../assets/pexels-jean-van-der-meulen-1457845.jpg";
import Altwo from "../assets/pexels-jean-van-der-meulen-2416932.jpg";
import Althree from "../assets/pexels-julie-aagaard-1374125.jpg";
// import Alfive from "../assets/pexels-m&w-studios-90317.jpg";
import Alsix from "../assets/pexels-m&w-studios-90319.jpg";
// import Alseven from "../assets/pexels-max-vakhtbovych-6492396.jpg";
import Blone from "../assets/pexels-max-vakhtbovych-6758352.jpg";
import Bltwo from "../assets/pexels-max-vakhtbovych-6758769.jpg";
import Blthree from "../assets/pexels-max-vakhtbovych-6782468.jpg";
import Blfive from "../assets/pexels-max-vakhtbovych-6782469.jpg";
import Blsix from "../assets/pexels-max-vakhtbovych-6782578.jpg";
import Blseven from "../assets/pexels-max-vakhtbovych-6890413.jpg";
import Slone from "../assets/pexels-max-vakhtbovych-6890413.jpg";
import Sltwo from "../assets/pexels-max-vakhtbovych-6890413.jpg";
import Slfive from "../assets/pexels-max-vakhtbovych-6890413.jpg";
import Sseven from "../assets/pexels-max-vakhtbovych-6890413.jpg";


export default function Designerbedroom() {
  return (
    <div className="imgglry">
      <div class="row">
        <div class="col-lg-4 col-md-12 mb-4 mb-lg-0">
          <img
            src={Glone}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          // style={{ borderWidth: 2, borderColor: 'black', }}
          />
          <img
            src={Slone}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          // style={{ borderWidth: 2, borderColor: 'black', }}
          />

          <img
            src={Gltwo}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />
        </div>

        <div class="col-lg-4 mb-4 mb-lg-0">
          <img
            src={Glthree}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />

          <img
            src={Glfive}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />
        </div>

        <div class="col-lg-4 mb-4 mb-lg-0">
          <img
            src={Glsix}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />
          <img
            src={Sltwo}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          // style={{ borderWidth: 2, borderColor: 'black', }}
          />

          <img
            src={Glseven}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />
        </div>
      </div>
      <div class="row">
        <div class="col-lg-4 col-md-12 mb-4 mb-lg-0">
          <img
            src={Alone}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          // style={{ borderWidth: 2, borderColor: 'black', }}
          />
            <img
            src={Glone}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          // style={{ borderWidth: 2, borderColor: 'black', }}
          />
          <img
            src={Altwo}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />
        </div>

        <div class="col-lg-4 mb-4 mb-lg-0">
          <img
            src={Althree}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />

          <img
            src={Slfive}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />
        </div>

        <div class="col-lg-4 mb-4 mb-lg-0">
          <img
            src={Alsix}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />
            <img
            src={Glone}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          // style={{ borderWidth: 2, borderColor: 'black', }}
          />
          <img
            src={Sseven}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />
        </div>
      </div>
      <div class="row">
        <div class="col-lg-4 col-md-12 mb-4 mb-lg-0">
          <img
            src={Blone}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          // style={{ borderWidth: 2, borderColor: 'black', }}
          />

          <img
            src={Bltwo}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />
        </div>

        <div class="col-lg-4 mb-4 mb-lg-0">
          <img
            src={Blthree}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />

          <img
            src={Blfive}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />
        </div>

        <div class="col-lg-4 mb-4 mb-lg-0">
          <img
            src={Blsix}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />

          <img
            src={Blseven}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          />
          {/* <img
            src={Glone}
            class="w-100 shadow-1-strong rounded mb-4"
            alt=""
          // style={{ borderWidth: 2, borderColor: 'black', }}
          /> */}
        </div>
      </div>
    </div>
  )
}
